import { Link } from 'react-router-dom';
import { publicRoutes } from '~/routes';

function Sidebar() {
    return (
        <ul>
            {publicRoutes.map((route, index) => (
                <li key={index}>
                    <Link to={route.path}>{route.name}</Link>;
                </li>
            ))}
        </ul>
    );
}

export default Sidebar;
